/**
 * Placements of a moved element relative to a target element.
 *
 * @public
 */
enum MovePlacement {
	/**
	 * @public
	 */
	On = "On",

	/**
	 * @public
	 */
	Before = "Before",

	/**
	 * @public
	 */
	After = "After",
}

export default MovePlacement;
